import React from 'react'
import './Nav.css'

const Nav = ({onSignOutClick}) => {
    return (
        <div className='nav'>
            <h1 id='logo'>H<span id='plus'>+</span></h1>
            <p 
                className='button'
                onClick={onSignOutClick}
            >
            Sign Out
            </p>
        </div>
    )
}

export default Nav;
